1000.body:
今回の場合，ユーザと tweet が「1 対多」の関係となっている． Laravel では，このような場合に親となるデータから子のデータを取得する方法が準備されている． app/Models/User.phpに以下のように編集する． // app/Http/Models/User.php class User extends Authenticatable
{ use HasApiTokens, HasFactory, Notifiable; // 省略 // 🔽 追加 public function mytweets() { return $this->hasMany(Tweet::class)->orderBy('updated_at', 'desc'); }
} ここで，User と Tweet を連携させるためには，子（Tweet）のカラムに「親_id」（<- 今回はuser_id）を用意しておく必要がある（前項で実施）． これでUserモデルを用いて，特定のユーザが投稿した tweet を取得できるようになる．

