1009.body:
tweet とユーザの関係は「多対 1」である（1 対多の逆）． Laravel では，この場合も連携ができる機能が準備されている． 設定はモデル部分に記述する．app/Http/Models/Tweet.phpを以下のように編集する． 子のモデルにbelongsTo()を設定することで親のモデルを指定することができる．これで「Tweet モデルは User モデルに属している」状態となる． // app/Http/Models/Tweet.php <?php namespace App\Models; use Illuminate\Database\Eloquent\Factories\HasFactory;
use Illuminate\Database\Eloquent\Model; class Tweet extends Model
{ use HasFactory; protected $guarded = [ 'id', 'created_at', 'updated_at', ]; public static function getAllOrderByDeadline() { return self::orderBy('updated_at', 'desc')->get(); } // 🔽 追加 public function user() { return $this->belongsTo(User::class); } }

1014.body:
テーブルの作成はマイグレーションで行う．まずはマイグレーションファイルを作成する． $ php artisan make:migration create_tweet_user_table マイグレーションファイル（database/migrations/2021_09_24_072924_create_tweet_user_table.php）を開き，up() 関数を以下のように編集する． // database/migrations/2021_09_24_072924_create_tweet_user_table.php public function up()
{ Schema::create('tweet_user', function (Blueprint $table) { $table->id(); // 🔽 ここから追加 $table->unsignedBigInteger('user_id'); $table->unsignedBigInteger('tweet_id'); $table->foreign('user_id')->references('id')->on('users')->onDelete('cascade'); $table->foreign('tweet_id')->references('id')->on('tweets')->onDelete('cascade'); $table->unique(['user_id', 'tweet_id']); // 🔼 ここまで追加 $table->timestamps(); });
}

1018.body:
User モデルに belongsToMany を設定して，User モデルは Tweet モデルと多対多の連携をすることを示す． // app/Http/Models/User.php <?php namespace App\Models; use Illuminate\Contracts\Auth\MustVerifyEmail;
use Illuminate\Database\Eloquent\Factories\HasFactory;
use Illuminate\Foundation\Auth\User as Authenticatable;
use Illuminate\Notifications\Notifiable;
use Laravel\Sanctum\HasApiTokens; class User extends Authenticatable
{ use HasApiTokens, HasFactory, Notifiable; // 省略 // 🔽 追加 public function tweets() { return $this->belongsToMany(Tweet::class)->withTimestamps(); }
} 同様に Tweet モデルにも belongsToMany を設定する． // app/Http/Models/Tweet.php <?php namespace App\Models; use Illuminate\Database\Eloquent\Factories\HasFactory;
use Illuminate\Database\Eloquent\Model; class Tweet extends Model
{ use HasFactory; // 省略 // 🔽 追加 public function users() { return $this->belongsToMany(User::class)->withTimestamps(); }
} ここまでで，データを連携させる設定は完了となる．

