1022.body:
ルーティングで設定したstore()関数とdestroy()関数の中身を実装する． app/Http/Controllers/FavoriteController.phpを以下のように編集する． attach()で中間テーブルへのデータの追加，detach()で中間テーブルからのデータ削除が実行される． // app/Http/Controllers/FavoriteController.php <?php namespace App\Http\Controllers; use Illuminate\Http\Request; // 🔽 2行追加
use App\Models\Tweet;
use Auth; class FavoriteController extends Controller
{ // 省略 // 🔽 編集 public function store(Tweet $tweet) { $tweet->users()->attach(Auth::id()); return redirect()->route('tweet.index'); } // 🔽 編集 public function destroy(Tweet $tweet) { $tweet->users()->detach(Auth::id()); return redirect()->route('tweet.index'); }
}

