119.body:
条件を満たすときと満たさないときで別々の処理を実行する！ if (`条件式`) { // 条件式を満たす場合の処理
} else { // 条件式を満たさない場合の処理
} 複数の条件で処理を分岐させることもできる！ if (`条件式1`) { // 条件式1を満たす場合の処理
} else if (`条件式2`) { // 条件式1と満たさなくて条件式2を満たす場合の処理
} else { // いずれの条件も満たさない場合の処理
}

122.body:
条件式は複数組み合わせることができる．下記 2 種類がよく使われる． 複数の条件式を全て満たす場合（AND 条件）は条件式を&&でつなぐ． 複数の条件式のいずれかを満たす場合（OR 条件）は条件式を||でつなぐ． if (`条件式1` && `条件式2`) { // 条件式1と条件式2を両方満たす場合の処理
} else { // 片方しか満たさない，両方満たさない場合の処理
} if (`条件式1` || `条件式2`) { // 条件式1か条件式2のどちらかを満たす場合の処理
} else { // 両方満たさない場合の処理
}

