350.body:
上記querySnapshot.docsは非常に複雑な形となっており，このまま扱うことは難しい． そのため，必要なデータのみ抽出した「オブジェクト形式の配列」に変換する． 空の配列を準備． querySnapshot.docsに対して繰り返し処理を用いて各要素に対して， .idでドキュメント ID（名前）を取得する． .data()でドキュメント中身（3 項目）を取得する． 上記のデータのみを 1 で用意した配列に追加． // chatapp.html
// 前項の`console.log()`下に記述 const dataArray = [];
querySnapshot.docs.forEach(function (doc) { const data = { id: doc.id, data: doc.data(), }; dataArray.push(data);
}); console.log(dataArray);

