データを受け取る 書き込み先のファイルを開く（なければ新たにファイルを作成） 他の人が書き込まないようロックする データを書き込む ロックを解除する ファイルを閉じる 入力画面に移動 // todo_txt_create.php // まずは`var_dump($_POST);`で値を確認すること！！ // データの受け取り
