$file = fopen('data/todo.txt', 'a');
// ファイルをロックする
flock($file, LOCK_EX); // 指定したファイルに指定したデータを書き込む
fwrite($file, $write_data); // ファイルのロックを解除する
flock($file, LOCK_UN);
// ファイルを閉じる
fclose($file); // データ入力画面に移動する
header("Location:todo_txt_input.php");

