$str = ''; // ファイルを開く（読み取り専用）
$file = fopen('data/todo.txt', 'r');
// ファイルをロック
flock($file, LOCK_EX); // fgets()で1行ずつ取得→$lineに格納
if ($file) { while ($line = fgets($file)) { // 取得したデータを`$str`に追加する $str .="<tr><td>{$line}</td></tr>"; }
} // ロックを解除する
flock($file, LOCK_UN);
// ファイルを閉じる
fclose($file); // `$str`に全てのデータ（タグに入った状態）がまとまるので，HTML内の任意の場所に表示する．

