717.body:
session_id がバレると他の人に session の中身をいじられてしまう可能性がある．．！ session_regenerate_id();を使用すると id を再生成して更新できる． （保存されているデータ自体は変更なし） 使い所 ログインしたら id 発行してログイン情報を管理． ページ移動など特定の操作をしたタイミングで再生成して古い id を無効化する． // session_regenerate_id.php <?php
// セッションの開始
session_start();
$old_session_id = session_id(); // 再生成
session_regenerate_id(true);
$new_session_id = session_id(); // 新旧のidを画面に表示して更新されていることを確認
echo "<p>旧id: {$old_session_id}</p>";
echo "<p>新id: {$new_session_id}</p>";
exit(); ?>

