tweet のデータを作成する際に，「誰が作成したのか」がわかるように，データにログインユーザの ID を追加する． app/Http/Controllers/TweetController.phpのstore()を内容を以下のように編集する． // app/Http/Controllers/TweetController.php public function store(Request $request)
{ // バリデーション $validator = Validator::make($request->all(), [ 'tweet' => 'required | max:191', 'description' => 'required', ]); // バリデーション:エラー if ($validator->fails()) { return redirect() ->route('tweet.create') ->withInput() ->withErrors($validator); } // 🔽 編集 フォームから送信されてきたデータとユーザIDをマージし，DBにinsertする $data = $request->merge(['user_id' => Auth::user()->id])->all(); $result = Tweet::create($data); // tweet.index」にリクエスト送信（一覧ページに移動） return redirect()->route('tweet.index');
} 【解説】 $request->merge()でユーザ ID を追加している． Auth::user()->idで現在ログインしているユーザの ID を取得することができる（Auth::id()でも可）． Auth::user()には他にもデータが入っているので，dd()などで確認してみると良いだろう．
